(async function () {
    // Settings can be changed from the tampermonkey menu


    const infoCount = 6;
    const timeInMatchPosition = infoCount + 1;
    const competitiveWinsPosition = timeInMatchPosition + 1;
    const dateOfLastGamePosition = competitiveWinsPosition + 1;


    const prevPlayers = JSON.parse(await GM_getValue("previousPlayers", "{}"));


    const HISTORYIMAGE = "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F2%2F27%2FOOjs_UI_icon_history.svg%2F1024px-OOjs_UI_icon_history.svg.png&f=1&nofb=1";
    const esportalRanks = [
        [0, "data:image/png;base64,"],
        [1000, "data:image/png;base64,"],
        [1100, "data:image/png;base64,"],
        [1200, "data:image/png;base64,"],
        [1300, "data:image/png;base64,"],
        [1400, "data:image/png;base64,"],
        [1500, "data:image/png;base64,"],
        [1600, "data:image/png;base64,"],
        [1700, "data:image/png;base64,"],
        [1800, "data:image/png;base64,"],
        [1900, "data:image/png;base64,"],
        [2000, "data:image/png;base64,"]
    ];

    let cfg = new MonkeyConfig({
        title: 'Settings',
        menuCommand: true,
        params: {
            win_threshold: {
                type: 'number',
                default: 500
            },
            playtime_threshold: {
                type: 'number',
                default: 1000
            },
            short_mode: {
                type: 'checkbox',
                default: false
            }
        }
    });

    function addHideOptions(id, account, premades) {
        let container = document.querySelector(".premade-container");
        if (!premades.includes(id)) {
            let image = account.querySelector(".account-steam-userpic-img-offline");
            if (image == null) image = account.querySelector(".account-steam-userpic-img-online");
            if (image == null) image = account.querySelector(".account-steam-userpic-img-ingame");
            const name = account.querySelector(".account-steam-name").children[0].innerText;

            if (container == null) {
                let main = document.getElementsByTagName('main')[0];
                let parent = document.createElement('div');
                parent.className = 'content content-block';
                let premadeContainer = document.createElement('div')
                premadeContainer.className = 'premade-container';
                parent.appendChild(premadeContainer);
                main.insertBefore(parent, main.children[0]);
                container = document.querySelector(".premade-container");
            }
            let rows = container.querySelectorAll(".singles-row");

            if (rows == null || rows.length === 0) {
                let spacer = document.createElement('div');
                spacer.className = 'premades_spacer';
                spacer.style.padding = '10px 0px';
                spacer.innerHTML = '<strong style="font-size: 14pt;color: #ff6900;">Singles:</strong>'
                container.appendChild(spacer);
                addSinglesRow(container, image, name, id);
            } else if (rows[rows.length - 1].querySelectorAll(".premade_toggle").length >= 5) addSinglesRow(container, image, name, id);
            else {
                // Add new player to the lowest singles row
                let row = rows[rows.length - 1];
                let newSingle = document.createElement('div');
                newSingle.className = "premade_players";
                newSingle.innerHTML = '<img class="premade_avatar" src="' + image.src + '">' + name
                    + '</div><div class="premade_toggle" onclick="togglePlayerViews\(\'' + id + '\'\)"><img id="premade_toggle_image_'
                    + id + '" class="premade_toggle_image" src="/themes/dark/images/switch_on.png">';
                let spacer = document.createElement('div');
                spacer.className = 'premade_plus';
                spacer.style.paddingLeft = '20pt';
                row.appendChild(spacer);
                row.appendChild(newSingle);
            }
            return;
        }
    }

    function addSinglesRow(container, image, name, id) {
        if (name.indexOf(" ") < 3) name = Array.from(name).slice(name.indexOf(" ") + 1).join('');
        let newSingle = document.createElement('div');
        newSingle.className = "premade-row singles-row";
        newSingle.innerHTML = '<div class="premade_players"><img class="premade_avatar" src="'
            + image.src + '">' + name + '</div><div class="premade_toggle" onclick="togglePlayerViews\(\''
            + id + '\'\)"><img id="premade_toggle_image_' + id
            + '" class="premade_toggle_image" src="/themes/dark/images/switch_on.png"></div>';
        container.appendChild(newSingle);
    }

    function getPremades() {
        let premades = [];
        document.querySelectorAll(".premade_toggle").forEach(toggle => {
            premades = premades.concat(toggle.onclick.toString().match(/\d+/g));
        });
        return premades;
    }

    // Ads a new data row at position (int, >7)
    function addInfoField(account, title, value, position, isBad, toolTip, image) {
        let steamInfoContainer;
        if (account.querySelector(".account-steaminfo-container") != null) steamInfoContainer = ".account-steaminfo-container";
        else steamInfoContainer = ".account-steaminfo-container-banned";

        if(cfg.get('short_mode')) account.querySelector(steamInfoContainer).style.height = (25 * infoCount) + 'px';
        if (cfg.get('short_mode') || account.querySelector("#A" + position) != null) return;

        // Set container height based on the number of entries
        let count = account.querySelector(steamInfoContainer).getAttribute("dataCount");
        if (count == null) {
            account.querySelector(steamInfoContainer).setAttribute("dataCount", infoCount + 1);
            count = infoCount + 1;
        } else {
            count++;
            account.querySelector(steamInfoContainer).setAttribute("dataCount", count);
        }
        account.querySelector(steamInfoContainer).style.height = (25 * count) + 'px';

        // Create new element
        let element = account.querySelectorAll(".account-steaminfo-row")[0].cloneNode(true);
        let innerElement = element.children[0].children[0].children[0].cloneNode();
        element.children[0].children[0].textContent = title;
        innerElement.textContent = value;
        innerElement.classList = "account-steaminfo-row-value";
        if (isBad) {
            innerElement.classList.add("account-steaminfo-row-value-urgent");
            element.children[0].children[0].classList = 'cross';
        } else element.children[0].children[0].classList = 'tick';
        element.children[0].children[0].appendChild(innerElement);
        element.setAttribute("id", "A" + position);
        if (toolTip != null) {
            element.setAttribute("title", toolTip);
            element.style.cursor = "help";
        }
        if (image != null) {
            let img = document.createElement('img');
            img.setAttribute("src", image);
            img.setAttribute("title", toolTip);
            img.style.width = "17px";
            img.style.position = "absolute";
            img.style.marginLeft = "10px";
            img.style.marginTop = "2px";
            img.style.filter = 'invert()';
            element.children[0].children[0].appendChild(img);
        }

        // Insert new element
        let previous;
        let iter = position;
        while (previous == null) {
            position--;
            previous = account.querySelector('#A' + position);
            if (position < 0) return;
        }
        if (previous != null) previous.after(element);
        else previous.after(element);
    }

    function removeInfoField(account, fieldNumber) {
        account.querySelector("#A" + fieldNumber).remove();
        let steamInfoContainer;
        if (account.querySelector(".account-steaminfo-container") != null) steamInfoContainer = ".account-steaminfo-container";
        else steamInfoContainer = ".account-steaminfo-container-banned";
        let count = account.querySelector(steamInfoContainer).getAttribute("dataCount");
        count--;
        account.querySelector(steamInfoContainer).setAttribute("dataCount", count);
        account.querySelector(steamInfoContainer).style.height = (25 * count) + 'px';
    }

    function setDateOfLastGame(account) {
        const APIkey = '84bcbcd9-2073-44d3-861a-08661ea2ed76';
        const game = 'csgo';
        // In unix time | This defines from which point in time onwwards faceit should find matches.
        // It just needs to be far ago enough that we can fetch the latest game even if it was played a long time ago.
        const beginTime = '1433232062'; // ~year2015
        const title = "Latest faceit match:";

        let steamInfoContainer
        if (account.querySelector(".account-steaminfo-container") != null) steamInfoContainer = ".account-steaminfo-container";
        else steamInfoContainer = ".account-steaminfo-container-banned";

        if (account.querySelector(".account-faceit-title-username") == null) {
            addInfoField(account, title, " - ", dateOfLastGamePosition, false, null, null);
            return;
        }
        const faceitNick = account.querySelector(".account-faceit-title-username").innerText;

        // Get user ID
        GM_xmlhttpRequest({
            method: "GET",
            url: 'https://open.faceit.com/data/v4/players?nickname=' + faceitNick + '&game=' + game,
            headers: {
                "Accept": "application/json",
                "Authorization": "Bearer " + APIkey
            },
            onload: function (response) {
                let userID = "";
                try {
                    userID = JSON.parse(response.response).player_id;
                } catch (error) {
                    console.log("Error getting userID:\n" + error);
                    addInfoField(account, title, " - ", dateOfLastGamePosition, false, null, null);
                }
                if (userID == "") return;

                // Ask for the latest match
                GM_xmlhttpRequest({
                    method: "GET",
                    url: 'https://open.faceit.com/data/v4/players/' + userID + '/history?game=' + game + '&from=' + beginTime + '&limit=1',
                    headers: {
                        "Accept": "application/json",
                        "Authorization": "Bearer " + APIkey
                    },
                    onload: function (response) {
                        let time = "";
                        try {
                            time = JSON.parse(response.response).items[0];
                        } catch (error) {
                            console.error("Error getting latest match:\n" + error);
                        }
                        if (time != null) time = time.finished_at; // In unix time
                        let date = new Date(time * 1000);
                        let formattedDate = date.getDate() + "." + (date.getMonth() + 1) + "." + date.getFullYear();
                        if (time == null || time == "") formattedDate = " - "; // If there are no matches, don't display a date.

                        addInfoField(account, title, formattedDate, dateOfLastGamePosition, false, null, null);
                    }
                });
            }
        });
    }

    // Gets user rank from csgostats.gg
    // And because of some monkey this also basically starts the whole thing
    function httpGet(account, theUrl, id) {
        let res;
        GM_xmlhttpRequest({
            method: "GET",
            url: theUrl,
            headers: {
                "Accept": "xml" // If not specified, browser defaults will be used.
            },
            onload: function (response) {
                res = new DOMParser().parseFromString(response.response, "text/html");

                // If private profile
                if (res.querySelector("#competitve-wins") == null) {
                    let noRank = document.createElement('img');
                    noRank.src = "https://static.csgostats.gg/images/ranks/0.png";
                    noRank.width = "92";
                    noRank.className = "rankImage";
                    setRank(id, noRank, "Private profile.");
                    return;
                }
                ;

                let rank = res.querySelector("#competitve-wins").parentElement.parentElement.children[0].children[0];
                let wins = parseInt(res.querySelector("#competitve-wins").children[1].innerText);
                //res.querySelector("#last-game").removeChild(res.querySelector("#last-game").children[0]);
                let lastGame = res.querySelector("#last-game").innerText.trim().replace('Last Game ', '');
                console.log(rank, wins, lastGame);
                setRank(id, rank, wins + ' Competitive wins.\nLast time rank updated: ' + lastGame + '\n(Rank from csgostats.gg)');

                addInfoField(account, "Competitive wins: ", wins, competitiveWinsPosition, (wins < cfg.get('win_threshold') || wins == "private"), null, null);
            }
        });
    }

    function convarsRank(id, account, csgostatsWins) {
        GM_xmlhttpRequest({
            method: "GET",
            url: "https://convars.com/csgostats/en/" + id,
            headers: {
                "Accept": "xml" // If not specified, browser defaults will be used.
            },
            onload: function (response) {
                let site = new DOMParser().parseFromString(response.response, "text/html");
                let rank = site.querySelector(".persRankImg");
                if (rank != null) account.querySelector(".rankImage").src = "https://convars.com" + rank.getAttribute("data-src");

                let wins = "private"
                if (site.querySelector(".persRankWins").children[0] != null) {
                    wins = parseInt(site.querySelector(".persRankWins").children[0].children[0].innerText);
                }
                if (wins > csgostatsWins) account.querySelector(".rankImage").parentElement.title = wins + " Competitive wins.";
                else account.querySelector(".rankImage").parentElement.title = csgostatsWins + " Competitive wins.";

                // Set rank
                let lastUpdate = site.querySelector(".persRankTipText").children;
                lastUpdate = lastUpdate[lastUpdate.length - 1].innerText;
                account.querySelector(".rankImage").parentElement.title += '\n' + lastUpdate + '\n';
                rank = rank.getAttribute("data-src");
                let a = [];
                a = a.concat(rank.match(/(\d+)/));
                if (a[0] != 0) {
                    account.querySelector(".rankImage").parentElement.title += "(Rank from convars.com)";
                    account.querySelector(".rankImage").parentElement.href = "https://convars.com/csgostats/en/" + id;
                } else {
                    account.querySelector(".rankImage").parentElement.title += "Rank Unknown";
                }

                // Get actual playtime
                setMatchTime(id, account, site);

                addInfoField(account, "Competitive wins:", wins, competitiveWinsPosition, (wins < cfg.get('win_threshold') || wins == "private"), null, null);
            }
        });
    }

    // Returns true if input hours are less than playtime_threshold
    function compareHours(input, threshold) {
        let text = Array.from(input);
        if (text.pop() != 'h') return true;
        text = text.join('');
        if (parseInt(text) < threshold) return true;
        return false;
    }

    function setMatchTime(id, account, site) {
        let image = null;
        if (site == null) {
            GM_xmlhttpRequest({
                method: "GET",
                url: "https://convars.com/csgostats/en/" + id,
                headers: {
                    "Accept": "xml" // If not specified, browser defaults will be used.
                },
                onload: function (response) {
                    site = new DOMParser().parseFromString(response.response, "text/html");
                    // Get actual playtime
                    try {
                        let time = site.querySelector("#round11").querySelectorAll(".polarStatsOthersix")[4].children[0].children[0].children[1].children[0].innerText;
                        let toolTip = null;
                        if (site.querySelector("#savedStatsDesc") != null) {
                            toolTip = "Players stats are hidden. Showing saved stats: " + site.querySelector(".savedStatsDate").innerText;
                            image = HISTORYIMAGE;
                        }
                        //addInfoField(account, "Time in match:", time, timeInMatchPosition, site.querySelector("#savedStatsDesc") != null, toolTip, image);
                        addInfoField(account, "Time in match: ", time, timeInMatchPosition, compareHours(time, cfg.get('playtime_threshold')), toolTip, image);
                    } catch (e) {
                        addInfoField(account, "Time in match: ", "private", timeInMatchPosition, true, "Player stats unavailable.", null);
                    }
                }
            });
        } else {
            // Get actual playtime
            try {
                let time = site.querySelector("#round11").querySelectorAll(".polarStatsOthersix")[4].children[0].children[0].children[1].children[0].innerText;
                let toolTip = null;
                if (site.querySelector("#savedStatsDesc") != null) {
                    toolTip = "Players stats are hidden. Showing saved stats: " + site.querySelector(".savedStatsDate").innerText;
                    image = HISTORYIMAGE;
                }
                addInfoField(account, "Time in match: ", time, timeInMatchPosition, compareHours(time, cfg.get('playtime_threshold')), toolTip, image);
            } catch (e) {
                addInfoField(account, "Time in match: ", "private", timeInMatchPosition, true, "Player stats unavailable.", null);
            }
        }
    }

    function setRank(id, rank, wins) {
        document.querySelector(".account-container").querySelectorAll(".account-row").forEach(account => {
            let accountID = account.children[0].name
            if (accountID == "") accountID = account.children[1].name;
            if (accountID == id) {
                if (wins == "Private profile.") convarsRank(id, account, 0);

                rank.className = "rankImage";
                let htmlObject = document.createElement('a'); // Create new object for housing the rank image
                htmlObject.href = "https://csgostats.gg/player/" + id;
                htmlObject.target = "_blank";
                htmlObject.className = "nolink";
                htmlObject.title = wins; // Add "tooltip" with competitive wins

                // Add Convars link
                let faceitLink = account.querySelector(".account-faceitinfo-container-arrow").parentElement;
                if (faceitLink.className == "account-faceitinfo-container") faceitLink = account.querySelector(".account-faceitinfo-container-arrow");

                let convarsLink = document.createElement('a'); // Create new object for housing the link
                convarsLink.href = "https://convars.com/csgostats/en/" + id;
                convarsLink.target = "_blank";
                convarsLink.className = "nolink";
                convarsLink.innerHTML = '<img src="https://convars.com/imgs/logo.png" class="account-convars-container-arrow" alt="Convars profile link">';
                if (faceitLink != null) faceitLink.parentElement.insertBefore(convarsLink, faceitLink);
                else {
                    faceitLink = account.querySelector(".account-faceitinfo-container").querySelector(".account-faceitinfo-container-arrow");
                    faceitLink.parentElement.insertBefore(convarsLink, faceitLink);
                }

                if (rank.id != "competitve-wins") {
                    htmlObject.appendChild(rank);
                    // Get actual playtime
                    setMatchTime(id, account, null);
                } else { // no rank
                    let noRank = document.createElement('img');
                    noRank.src = "https://static.csgostats.gg/images/ranks/0.png";
                    noRank.width = "92";
                    noRank.className = "rankImage";
                    htmlObject.appendChild(noRank);

                    // If no rank -> search convars for rank
                    let a = [];
                    a = a.concat(wins.match(/(\d+)/));
                    convarsRank(id, account, a[0]);
                }

                // If faceit account is found add rank image
                if (account.querySelector(".esportalRank") != null) account.querySelector(".esportalRank").before(htmlObject);
                else if (account.querySelector(".account-faceit-level").children.length === 0) account.querySelector(".account-faceit-level").appendChild(htmlObject);
                else if (account.querySelector(".account-faceit-level") != null) account.querySelector(".account-faceit-level").children[0].after(htmlObject);
            }
        });
    }

    async function configFaceitNotFound(account) {
        if (account.querySelector(".account-faceit-level") == null) {
            const text = account.querySelector(".account-faceit-notfound").innerText;
            account.querySelector(".account-faceit-notfound").innerText = "";
            let spacerB = document.createElement('div');
            spacerB.className = "account-faceit-title";
            let spacerC = document.createElement('div');
            spacerC.className = "account-faceit-notfound";
            spacerC.innerText = text;
            spacerC.style.height = "30px";
            spacerC.style.marginBottom = "30px";
            account.querySelector(".account-faceit-notfound").before(spacerB);
            account.querySelector(".account-faceit-notfound").after(spacerC);
            account.querySelector(".account-faceit-notfound").className = "account-faceit-level";
        }
    }

    function cheaterChance(account, iterator) {
        if (iterator == undefined) iterator = 0;
        const date = new Date();
        let log = "";
        const playtime_threshold = cfg.get('playtime_threshold');
        const win_threshold = cfg.get('win_threshold');
        const trust = account.querySelector(".account-steam-trust");
        const trustBarLeft = trust.children[0].children[0];
        const trustBarRight = trust.children[0].children[1];
        trustBarLeft.style.display = 'none';
        trustBarRight.style.display = 'none';

        try {
            let wins = account.querySelector(`#A${competitiveWinsPosition}`).querySelector('.account-steaminfo-row-value').innerText;
            let time = account.querySelector(`#A${timeInMatchPosition}`).querySelector('.account-steaminfo-row-value').innerText;
            if (time.includes('m')) time = 0;
            else if (time.trim() === 'private') time = "wins";
            else time = parseInt(time.substring(0, time.length - 1));
            if (wins.trim() === 'private') {
                if (time.trim() === 'private') {
                    time = 0.0;
                    wins = 0;
                } else wins = 0.5 * time;
            } else wins = parseInt(wins);

            let years;
            let startedPlaying = account.querySelectorAll('.account-steaminfo-row')[2].querySelector('.account-steaminfo-row-value').innerText;
            if (account.querySelectorAll('.account-steaminfo-row')[0].querySelector('.account-steaminfo-row-value').innerText === 'Private') {
                const faceitMatch = account.querySelector(`#A${dateOfLastGamePosition}`).querySelector('.account-steaminfo-row-value').innerText;
                if (faceitMatch.includes('.')) startedPlaying = parseInt(faceitMatch.split('.')[2]);
                else startedPlaying = date.getFullYear();
                years = startedPlaying;
            } else if (startedPlaying.trim() !== 'private') {
                startedPlaying = startedPlaying.split('.')[2];
                years = startedPlaying;
            } else {
                startedPlaying = account.querySelectorAll('.account-steaminfo-row')[1].querySelector('.account-steaminfo-row-value').innerText;
                startedPlaying = startedPlaying.split('.')[2];
                years = startedPlaying;
                if (date.getFullYear() - startedPlaying > 5) startedPlaying = date.getFullYear() - 2;
            }

            let faceitEloGain = 0;
            let faceitPenalty = 1.0;
            try {
                const id = account.children[0].getAttribute('name');
                log += '\nAccount ID ' + id;
                wins += parseInt(account.querySelector(`#faceitmore_${id}`).children[1].children[0].innerText);

                const faceit = account.querySelector(`#faceitbase_${id}`)
                const matches = parseInt(faceit.children[0].children[0].innerText);
                const elo = parseInt(faceit.children[1].children[0].innerText) - 1000;
                faceitEloGain = elo / matches;
                if (matches > 0 && matches < 300 && elo > 1000) {
                    faceitPenalty = matches / 300;
                }
            } catch (e) {
                //console.error(e);
            }

            if (time === "wins") time = wins;

            let achievements = "Hacked";
            const rows = account.querySelectorAll(".account-steaminfo-row");
            if (rows.length > infoCount - 1) achievements = rows[infoCount - 2].querySelector(".account-steaminfo-row-value").innerText;

            const points = {};
            points['winPoints'] = wins / (win_threshold * 2);
            points['timePoints'] = time / (playtime_threshold * 2);
            points['yearPoints'] = (date.getFullYear() - startedPlaying) / (date.getFullYear() - 2012);
            points['hoursPerYear'] = time / ((date.getFullYear() - years) * 350); // 200h per year for max points
            if (faceitEloGain > 0.0) points['faceitEloGain'] = 1.0 / faceitEloGain; // <1 elo per match for max points

            let avg = 0;
            for (const key in points) {
                if (points[key] > 1.0) points[key] = 1.0;
                avg += points[key];
                log += "\n" + key + " - " + points[key];
            }
            avg = avg / Object.keys(points).length;

            log += `\nFaceit penalty: ${Math.round((1.0 - faceitPenalty) * 100)}%`;

            if (achievements === 'Hacked') avg = 0.2 * avg;
            avg = avg * faceitPenalty; // Penalty for bought and boosted lvl10 accounts
            console.log(log, "\nAverage", avg);


            trustBarLeft.style.display = '';
            trustBarRight.style.display = '';
            trust.title = `Probability of being legit: ${Math.round(avg * 100)}% \n${log}`;
            trustBarLeft.style.width = `${avg * 100}%`;
            trustBarRight.style.width = `${100 - avg * 100}%`;
            if (avg > 0.75) trustBarLeft.className = 'steam-trust-progress';
            else if (avg > 0.50) trustBarLeft.className = 'steam-trust-progress-yellow';
            else if (avg > 0.25) trustBarLeft.className = 'steam-trust-progress-orange';
            else trustBarLeft.className = 'steam-trust-progress-red';

            trustBarLeft.style.background = `linear-gradient(rgb(${200 * (1 - avg)}, ${200 * avg}, ${0}), rgb(${170 * (1 - avg)}, ${170 * avg}, ${0}))`;
            trustBarLeft.style.borderTop = `1px solid rgb(${255 * (1 - avg)}, ${255 * avg}, ${0})`;
            trustBarLeft.style.borderBottom = `1px solid rgb(${140 * (1 - avg)}, ${140 * avg}, ${0})`;

        } catch (e) {
            if (iterator > 150) return; // This is to avoid an infinite loop. Timeout in ~30s
            window.setTimeout(() => {
                cheaterChance(account, iterator++);
            }, 200);
        }
    }

    function getEsportalRank(account, identifier) {
        identifier = BigInt(identifier) - BigInt(76561197960265728n);

        GM_xmlhttpRequest({
            method: "GET",
            url: `https://esportal.com/api/user_profile/get?_=1&id=${identifier.toString()}`,
            headers: {
                "Accept": "xml" // If not specified, browser defaults will be used.
            },
            onload: function (response) {
                let data = response.response;
                if (response.status === 404) {
                    console.log("No esportal profile found for", identifier);
                    return;
                }
                try {
                    data = JSON.parse(data);
                    let rankImage = esportalRanks[esportalRanks.length - 1][1];
                    for (let i = 1; i < esportalRanks.length; i++) {
                        if (data.elo < esportalRanks[i][0]) {
                            rankImage = esportalRanks[i - 1][1];
                            break;
                        }
                    }
                    let container = document.createElement('div');
                    let htmlObject = document.createElement('a'); // Create new object for housing the rank image
                    htmlObject.href = "https://esportal.com/profile/" + data.username;
                    htmlObject.target = "_blank";
                    htmlObject.className = "nolink";
                    htmlObject.title = data.username; // Add "tooltip" with competitive wins
                    let rank = document.createElement('img');
                    rank.src = rankImage;
                    rank.width = 48;
                    rank.height = 48;
                    const matches = data.wins + data.losses;
                    rank.title = `Esportal stats\n\n`
                        + `Username: ${data.username}\n`
                        + `Matches: ${matches}  WR: ${Math.round((data.wins / matches) * 100)}%\n`
                        + `ELO: ${data.elo}\n`
                        + `K/D: ${(data.kills / data.deaths).toPrecision(3)}  HS: ${Math.round((data.headshots / data.kills) * 100)}%`;
                    htmlObject.appendChild(rank);
                    container.style.position = "relative";
                    if (data.recent_matches < 5) {
                        let lock = document.createElement('img');
                        lock.src = "data:image/svg+xml;base64,";
                        lock.className = "user-profile-rank-lock";
                        lock.title = rank.title;
                        htmlObject.children[0].after(lock);
                    }
                    container.appendChild(htmlObject);
                    container.className = "esportalRank";
                    account.querySelector('.account-faceit-level').appendChild(container);
                } catch (e) {
                    console.error(e);
                }
                console.log(data);
            }
        });
    }

    async function addPlayerHistory(account) {
        const steamID = account.children[0].getAttribute('name');
        const date = new Date();
        const currentDate = `${date.getDate()}.${date.getMonth()}.${date.getFullYear()}`;
        if (!prevPlayers.hasOwnProperty(steamID)){
            prevPlayers[steamID] = JSON.parse(`{"count": 1, "lastTime":"${currentDate}"}`)
        }
        else if(prevPlayers[steamID].lastTime !== currentDate){
            console.log(`You have played with ${account.querySelector(".account-steam-name").innerText} ${prevPlayers[steamID].count} time(s) before`);
            prevPlayers[steamID].count++;
            prevPlayers[steamID].lastTime = currentDate;
        }
        else{
            console.log(`Player ${account.querySelector(".account-steam-name").innerText} was not added to history, since you've already played with them today`);
        }
    }

    function start() {
        let premades = getPremades();

        document.querySelectorAll(".account-row").forEach(async account => {
            let accountID = account.children[0].name;
            if (accountID == "") accountID = account.children[1].name;
            let steamInfoContainer;
            if (account.querySelector(".account-steaminfo-container") != null) steamInfoContainer = ".account-steaminfo-container";
            else steamInfoContainer = ".account-steaminfo-container-banned";

            addHideOptions(accountID, account, premades);

            let children = account.querySelector(steamInfoContainer).children;
            children[children.length - 1].id = `A${infoCount}`;
            try {
                children[children.length - 3].remove();
            } catch (e) {
                console.error("Tried removing 2 weeks hours", e);
            }

            // Remove vlad from smurf button
            let vlad = account.querySelector(`#A${infoCount}`).children[0].children[0];
            if (vlad.children.length > 1) vlad.children[1].style.cursor = "";

            await addPlayerHistory(account);
            // Add coherent styling when account has no faceit
            await configFaceitNotFound(account);
            // Get latest faceit match
            setDateOfLastGame(account, 0);
            // Get rank and other data from csgostats and convars
            httpGet(account, "https://csgostats.gg/player/" + accountID, accountID);
            cheaterChance(account);
            getEsportalRank(account, accountID);
            if (account.querySelector(".account-faceit-detailed-stats") != null) account.querySelector(".account-faceit-detailed-stats").children[0].target = '_black';
        });
        GM_setValue("previousPlayers", JSON.stringify(prevPlayers));

        adjustCSSRules('.account-row', 'height: unset');
        adjustCSSRules('.steam-trust-progress-orange', 'display: inline-block');
        adjustCSSRules('.steam-trust-progress-orange', 'height: 8px');
        adjustCSSRules('.steam-trust-progress-orange', 'overflow: hidden');
        adjustCSSRules('.user-profile-rank-lock', 'position: absolute')
        adjustCSSRules('.user-profile-rank-lock', 'top: 50%')
        adjustCSSRules('.user-profile-rank-lock', 'left: 50%')
        adjustCSSRules('.user-profile-rank-lock', 'transform: translate(-50%,-60%)')
        adjustCSSRules('.user-profile-rank-lock', 'opacity: .85')
        adjustCSSRules('.user-profile-rank-lock', 'width: 15px')
        adjustCSSRules('.account-faceit-level', 'display: flex')
        adjustCSSRules('.account-faceit-level', 'flex-direction: row')
        adjustCSSRules('.account-faceit-level', 'flex-wrap: nowrap')
        adjustCSSRules('.account-faceit-level', 'align-content: center')
        adjustCSSRules('.account-faceit-level', 'justify-content: center')
        adjustCSSRules('.account-faceit-notfound', 'line-height: ')

        // Adds functionality for moving accounts to different team
        // First create and add a second account-container
        let container = document.createElement('div');
        container.className = "account-container";
        document.querySelector('.account-container').parentElement.appendChild(container);

        premades = [];
        let fullPremadeFound = false;
        // Add functionality
        document.querySelectorAll(".premade_toggle").forEach(toggle => {
            let players = [];
            players = players.concat(toggle.onclick.toString().match(/\d+/g));
            players.forEach(player => {
                premades.push(player);
            });
            toggle.onclick = function () {
                let image = toggle.children[0];
                const toggleOn = 'https://faceitfinder.com/themes/dark/images/switch_on.png';
                const toggleOff = 'https://faceitfinder.com/themes/dark/images/switch_off.png';

                if (image.src == toggleOn) image.src = toggleOff;
                else image.src = toggleOn;

                // Move account side
                players.forEach(premade => {
                    // Toggle in ON position equals to account being in the upper container
                    let acc = document.querySelectorAll('#player_' + premade);
                    if (image.src == toggleOn) {
                        acc[0].style.display = "inline-table"
                        acc[1].style.display = "none"
                    } else {
                        acc[0].style.display = "none"
                        acc[1].style.display = "inline-table"
                    }

                });
            };
            // If full premade we can switch players automatically
            if (players.length == 5 && !fullPremadeFound) {
                fullPremadeFound = true; // This prevents us from moving 2 full premades down
                players.forEach(player => {
                    updatePlayer(player)
                });
                toggle.click();
            }
        });

        // Add observers to players in upper container.
        // This (and updatePlayer()) keeps the lower container up to date with the upper container.
        premades.forEach(player => {
            updatePlayer(player);

            // Add mutation observer
            const targetNode = document.querySelector('#player_' + player);
            const config = {attributes: true, childList: true, subtree: true};
            const callback = function (mutationsList, observer) {
                updatePlayer(player)
            };
            const observer = new MutationObserver(callback);
            // Start observing the target node for configured mutations
            observer.observe(targetNode, config);

        });

        // Add style for the rank images
        let sheet = window.document.styleSheets[0];
        sheet.insertRule('.rankImage { margin-right: 20px; margin-left: 20px; margin-top: 6px;}', sheet.cssRules.length);
        sheet.insertRule('.account-faceit-notfound {display: inline-grid; line-height: 20px; height: 45px;}', sheet.cssRules.length);
        sheet.insertRule('.account-convars-container-arrow { height: 16px; position: absolute; top: 5px; right: 26px;}', sheet.cssRules.length);
        adjustCSSRules('.premade_toggle', 'padding-left: 0px');
    }

    function updatePlayer(player) {
        let secondContainer = document.querySelectorAll('.account-container')[1]
        let elem = document.querySelector('.account-container')
            .querySelector('#player_' + player).cloneNode(true)
        elem.classList.add(elem.id);
        elem.style.display = "none";
        if (secondContainer.querySelector('#player_' + player) != null) {
            if (secondContainer.querySelector('#player_' + player).style.display == "none") elem.style.display = "none";
            else elem.style.display = "inline-table";
            let nextAccount = secondContainer.querySelector('#player_' + player).nextElementSibling;
            let previousAccount = secondContainer.querySelector('#player_' + player).previousElementSibling;
            secondContainer.querySelector('#player_' + player).remove();
            if (nextAccount != null) nextAccount.before(elem);
            else if (previousAccount != null) previousAccount.after(elem);
            else secondContainer.appendChild(elem);
        } else secondContainer.appendChild(elem);

        // Make it possible to toggle faceit stats
        let baseInfoId = "faceitbase_" + player;
        let moreInfoId = "faceitmore_" + player;
        let baseInfoElement = secondContainer.querySelector("#" + baseInfoId);
        let moreInfoElement = secondContainer.querySelector("#" + moreInfoId);
        if (baseInfoElement != null) {
            baseInfoElement.onclick = function (player) {
                if (baseInfoElement.style.display === "none") {
                    baseInfoElement.style.display = "block";
                    moreInfoElement.style.display = "none";
                } else {
                    baseInfoElement.style.display = "none";
                    moreInfoElement.style.display = "block";
                }
            }
            moreInfoElement.onclick = baseInfoElement.onclick;
        }

        // Make it possible to toggle alias history
        secondContainer.querySelector("#player_" + player).querySelector(".steam-alias-history-link").onclick = function () {
            let aliasHistoryId = "alias_" + player;
            let baseHistoryElement = secondContainer.querySelector("#" + aliasHistoryId);
            if (baseHistoryElement.style.display === "none") {
                baseHistoryElement.style.display = "block";
            } else {
                baseHistoryElement.style.display = "none";
            }
        }

        // Make it possible to show smurf accounts
        let imageParent = secondContainer.querySelector("#player_" + player).querySelector(`#A${infoCount}`).children[0].children[0].children[1];
        const steamInfoElementId = "steaminfo_" + player;
        const smurfsElementId = "smurfs_" + player;
        if (imageParent != null) {
            imageParent.onclick = function () {
                let steamInfoElement = secondContainer.querySelector("#" + steamInfoElementId);
                let smurfsElement = secondContainer.querySelector("#" + smurfsElementId);
                if (steamInfoElement.style.display === "none") {
                    steamInfoElement.style.display = "block";
                    smurfsElement.style.display = "none";
                } else {
                    steamInfoElement.style.display = "none";
                    smurfsElement.style.display = "block";
                }
            }
            secondContainer.querySelector("#" + smurfsElementId).children[0].onclick = imageParent.onclick;
        }

    }

    function adjustCSSRules(selector, props, sheets) {
        // get stylesheet(s)
        if (!sheets) sheets = [...document.styleSheets];
        else if (sheets.sup) { // sheets is a string
            let absoluteURL = new URL(sheets, document.baseURI).href;
            sheets = [...document.styleSheets].filter(i => i.href == absoluteURL);
        } else sheets = [sheets]; // sheets is a stylesheet

        // CSS (& HTML) reduce spaces in selector to one.
        selector = selector.replace(/\s+/g, ' ');
        const findRule = s => [...s.cssRules].reverse().find(i => i.selectorText == selector)
        let rule = sheets.map(findRule).filter(i => i).pop()

        const propsArr = props.sup
            ? props.split(/\s*;\s*/).map(i => i.split(/\s*:\s*/))
            : Object.entries(props);

        if (rule) {
            for (let [prop, val] of propsArr) {
                // rule.style[prop] = val; is against the spec, and does not support !important.
                rule.style.setProperty(prop, ...val.split(/ *!(?=important)/));
            }
        } else {
            let sheet = sheets.pop();
            if (!props.sup) props = propsArr.reduce((str, [k, v]) => `${str}; ${k}: ${v}`, '');
            sheet.insertRule(`${selector} { ${props} }`, sheet.cssRules.length);
        }
    }

    start();

    let banner = document.createElement("div");
    banner.id = "banner";
    banner.style = "position: fixed; top: 0; left: 0; width: 100%; height: 30px; background-color: #ff0000; color: #ff;" +
        " font-size: 20px; font-weight: bold; text-align: center; z-index: 99999;";
    banner.innerHTML = `
        <div id="banner_text">
            <span id="banner_text_title">This script is no longer maintained, you can try </span>
            <a id="banner_text_link" href="https://csgofinder.eu/" style="color: #1000ff">my new site</a>
            <span id="banner_text_title"> instead.</span>
        </div>
    `;
    document.body.appendChild(banner);

})();
